import os

def allUnique(x):
    seen = set()
    return not any(i in seen or seen.add(i) for i in x)

input = ""

for i in range(len(input)):
    uniq_check = []

    for j in range(14):
        uniq_check.append(input[i+j])

    print(uniq_check)

    if (allUnique(uniq_check)):
        print("First Message after: ", (i+14))
        break
